import PropTypes from 'prop-types';

export default function HourlyForecast(props) {
	return (
		<div>
			<div>{new Date(props.hourly.data[0].time * 1000).toString()}</div>
			<div>{props.hourly.data[0].temperature}</div>
			<div>{props.hourly.data[0].summary}</div>
		</div>
	);
}
